import React, { Component } from "react";

class Home extends Component {
  state = {};
  render() {
    return (
      <div id="home" className="section center-both-ways">
        <div className="cont">
          <p className="home-msg">Hi, I'm Michael !</p>
          <p>I am currently seeking summer 2021 internships.</p>
          <p>Thanks for stopping by!</p>
        </div>
      </div>
    );
  }
}

export default Home;
